import Layout from "../components/layout/layout";

function Dashboard() {
  const position = {
    container: "flex gap-3 w-full h-full",
    leftwrapper: "w-1/3",
    rightwrapper: "2/3",
  };
  const design = { container: "bg-gray-100" };

  return (
    <Layout>
      <div className={`${position.container} ${design.container}`}>
        <div className={position.leftwrapper}></div>
        <div className={position.rightwrapper}></div>
      </div>
    </Layout>
  );
}

export default Dashboard;
